exampleList.push({ phrase: `中国的两条最长的河流，一条在南方，叫“长江”，全长六千三百多公里；另一条在北方，有五千四百多公里长，它穿过黄土高原，使河水变黄了，所以叫“黄河”。`, lesson: `MC2-9`});
