exampleList.push({ phrase: `他的儿子看到这匹又高又大的马，喜欢极了。不管父亲说什么，他都不听，一定要骑上去试一试。结果，不小心从马背上摔下来，把一条腿摔坏了。周围的人看见他连路都走不了了，都觉得很遗憾。老人还是什么话也没说。`, lesson: `MC2-9`});
