exampleList.push({ phrase: `结果，两年以后，当我们结婚的时候，单位的房子已经全部分完了。我们只好跟父母挤在一起，挤了差不多十年。`, lesson: `MC2-12`});
exampleList.push({ phrase: `上个世纪末，城市住房可以像商品一样自由买卖了，“福利住房”变成了历史。`, lesson: `MC2-12`});
exampleList.push({ phrase: `刚刚成年的“80后”，如果没有父母的帮助，就不得不靠自己的经济能力来解决住房问题。`, lesson: `MC2-12`});
exampleList.push({ phrase: `他们的收入一般比较低，而可怕的是，房价却越涨越快。到底是买房好，还是租房好呢？`, lesson: `MC2-12`});
exampleList.push({ phrase: `公司白领许虹：我犹豫了很久才决定买房。因为，要是现在还不买的话，以后连郊区的房子都买不起了。而且，租房没有安全感，随时都会被房主赶出去。`, lesson: `MC2-12`});
exampleList.push({ phrase: `现在，我那套“二手房”已经快装修好了。至少从搬进去的第一天起，我就会觉得有自己的财产和个人空间了。`, lesson: `MC2-12`});
exampleList.push({ phrase: `理发师周民：我想好了，决不为房地产商和银行“打工”，可是，我也不愿意向父母要钱。他们将来退休以后，岁数大了，万一生病或有急需怎么办？`, lesson: `MC2-12`});
exampleList.push({ phrase: `我的一些朋友虽然住进了自己的房子，却欠了一大笔钱。所有的计划，比如购物啊、娱乐啊、旅行啊，全都取消了，日子过得既紧张又辛苦。我们都还年轻，这样的生活有什么意义呢？`, lesson: `MC2-12`});
exampleList.push({ phrase: `从前，有一个叫白迟的人。他非常有钱，同时也非常愚蠢。但是，他又总觉得自己很了不起，什么都懂，因此常常做出一些让别人哭笑不得的事来。`, lesson: `MC2-12`});
exampleList.push({ phrase: `有一次，他到朋友家去做客。那家人住在一座非常漂亮的三层楼的楼房里。吃饭以前，主人把客人们带到三层的阳台上，从那里能看见远处美丽的风景。白迟看了羡慕极了，心里想：我也要按照这个样子盖一座三层楼房，而且要盖得比他的还好！`, lesson: `MC2-12`});
exampleList.push({ phrase: `他回到家里，马上叫人请来泥瓦匠，对他们说：“马上给我建一座三层楼房，越快越好！”第二天，泥瓦匠们立刻动工，开始打地基。白迟想楼房都快想疯了。他天天跑到工地上去看看房子盖到哪儿了。`, lesson: `MC2-12`});
exampleList.push({ phrase: `几天以后，地基打好了。又过了几天，多了几层砖。再过几天，砖又高了一些。`, lesson: `MC2-12`});
exampleList.push({ phrase: `白迟实在等得不耐烦了，就问泥瓦匠：“你们建的是什么房子啊，怎么一点也不像我要的楼房呢？”泥瓦匠回答说：“不是照您说的样子建楼房吗？这是第一层。”`, lesson: `MC2-12`});
exampleList.push({ phrase: `白迟又问：“那，这么说，你们还得修第二层吗？”泥瓦匠都觉得这个问题很奇怪，回答说：“那当然了，怎么啦？”白迟听了气坏了，大叫起来：“蠢东西，我要的是第三层，叫你们盖的也是第三层，第一层和第二层我家现在都有，还盖什么？”`, lesson: `MC2-12`});
exampleList.push({ phrase: `“空中楼阁”就是建在半空中的楼房。人们用这个成语来说明一个很简单的道理：不管做什么事情，都要从头开始，一点一点地打好基础。`, lesson: `MC2-12`});
exampleList.push({ phrase: `不然，我们的理想就会像这个有钱人的空中楼阁一样，永远是虚幻的东西。另外，这个成语也可以用来形容没有根据的、事实上不存在的东西或者想法。`, lesson: `MC2-12`});
