exampleList.push({ phrase: `自从1998年中国出现了第一部“网络小说”以来，“网络文学”发展的速度很快。`, lesson: `MC2-13`});
exampleList.push({ phrase: `据说，那些最看好的大网站家家都有好几百万会员，每天能收到几千篇作品，其中有不少是长篇小说。有些作品在网上发表以后，读者的点击数一天就能达到七、八十万次！`, lesson: `MC2-13`});
exampleList.push({ phrase: `为什么文学网站这么受欢迎？通过网络来写作或者阅读，到底是好事还是坏事？这些作品能不能算是文学？关于这些问题，网上的讨论非常热烈。`, lesson: `MC2-13`});
exampleList.push({ phrase: `发表意见的人当中，既有专家学者，也有普普通通的网民。`, lesson: `MC2-13`});
exampleList.push({ phrase: `专家甲：我认为只能说有“网络写作”，并不存在什么“网络文学”。因为纯文学是非常严肃的。一个真正的作家为了文学可以付出一切。`, lesson: `MC2-13`});
exampleList.push({ phrase: `专家乙：我不同意。什么是纯文学？一部作品是不是纯文学，应该由谁来决定？是几个大专家、大学者说了算吗？事实上，很多受读者欢迎的作家都进不了“文学史”。`, lesson: `MC2-13`});
exampleList.push({ phrase: `专家甲：可我说的也是事实啊。我在博客上发表过一篇文章，就是想说明这个问题。现在出现的“付费阅读”，读一页要付几分钱，已经使有些网站商业化了。`, lesson: `MC2-13`});
exampleList.push({ phrase: `他们有一批专业“写手”，完全是为了钱而写作，每天必须交一章。这样哪能写出有文学性的好作品来呢？都是垃圾。`, lesson: `MC2-13`});
exampleList.push({ phrase: `专家乙：怎么可以这样讲呢？我专门研究过网络文学。首先，能靠写作来挣钱的人只是少数；其次，大部分网站还是免费的。`, lesson: `MC2-13`});
exampleList.push({ phrase: `在我看来，这些年轻的作者们根本不在乎文学界对他们的态度，大概也永远不会被专家学者们接受，但这才是真正的大众写、大众看的文学。`, lesson: `MC2-13`});
exampleList.push({ phrase: `网友甲：总的来说，网络作品给我的印象是什么不健康的内容都有，水平太低，换句话说，就是文笔差，情节差，人物差，反正我看不下去。`, lesson: `MC2-13`});
exampleList.push({ phrase: `我要是有未成年的孩子，就禁止他上网看小说。还有，网虫们总是使用一些乱七八糟的网络语言，让人根本看不懂。`, lesson: `MC2-13`});
exampleList.push({ phrase: `网友乙：我觉得，不能把所有这些作品都看成垃圾。有的也表达了很深的思想和感情，文笔又新又美。`, lesson: `MC2-13`});
exampleList.push({ phrase: `不过，现在的青少年既没有什么文化知识，也没有多少社会经验，分不清楚好坏。他们对名著又不感兴趣。这确实是个问题。`, lesson: `MC2-13`});
exampleList.push({ phrase: `网友丙：我看，问题是那些管理网站的人。他们让读者投票，得票最多的就是好作品，还说这叫“民主”。`, lesson: `MC2-13`});
exampleList.push({ phrase: `网友丁：我不反对网络文学。写书这种事不是任何人都做得到的，敢把自己写的东西放在网上发表，让很多人看，有什么不好呢？至于网络语言嘛，谁也管不了，也用不着担心。说实话，到现在为止，那些奇奇怪怪的说法只能用在网上，对我们的生活并没有多大的影响。举个例子来说吧，你跟人告别的时候，能说“88”吗？`, lesson: `MC2-13`});
exampleList.push({ phrase: `“天干”和“地支”是中国古代用来计算年、月、日和时间的符号，就像印度人或阿拉伯人使用的数字一样。`, lesson: `MC2-13`});
exampleList.push({ phrase: `中国人除了把天干地支当作历法以外，还认为它和天地万物、阴阳五行都有很大的关系。`, lesson: `MC2-13`});
exampleList.push({ phrase: `十个天干是：甲、乙、丙、丁、戊、己、庚、辛、壬、癸，十二个地支是：子、丑、寅、卯、辰、巳、午、未、申、酉、戌、亥。`, lesson: `MC2-13`});
exampleList.push({ phrase: `中国古人把天干和地支按照顺序组合起来，天干在前，地支在后，就成了“甲子、乙丑、丙寅、丁卯⋯⋯”，一共六十个单位，也就是六十年，算作一个周期。`, lesson: `MC2-13`});
exampleList.push({ phrase: `这个周期完了以后，再从“甲子”开始，不断地循环下去。比如说，从阳历的2010年2月14日开始，就是阴历的“庚寅年”。`, lesson: `MC2-13`});
exampleList.push({ phrase: `另外，十二个地支还和十二个生肖连在一起，也就是十二种动物，除了龙是传说中的以外，其他都是自然界中存在的：鼠、牛、虎、兔、龙、蛇、马、羊、猴、鸡、狗、猪。`, lesson: `MC2-13`});
exampleList.push({ phrase: `这样连在一起以后就变成了：子鼠、丑牛、寅虎、卯兔、辰龙、巳蛇、午马、未羊、申猴、酉鸡、戌狗、亥猪，所以“庚寅年”就是“虎年”。在这一年出生的孩子们都属虎。`, lesson: `MC2-13`});
exampleList.push({ phrase: `这就是中国人常常问的问题：“你是属什么的？”所以生肖也叫！“属相”。自己的属相年也叫做“本命年”。每过12年，人们就要遇到自己的本命年。北方人习惯买一条红腰带系在腰上，认为这样才可以平平安安地度过这一年。`, lesson: `MC2-13`});
exampleList.push({ phrase: `一直到今天，天干地支不但用在农历里，在日常生活的词汇里，“甲乙丙丁”四个数字也经常作为数字来使用，比如说，甲级就是第一级，乙等就是第二等（注意，“乙”要念第二声！）。文章里如果有两个人对话，甲就代表第一个说话的人，乙是第二个人，就像法文里用A或者B一样。`, lesson: `MC2-13`});
